import React from 'react';
import CalculatorForm from './CalculatorForm';
import CalculatorResults from './CalculatorResults';

function Calculator({handleInputChange, ...props}) {
    return (
        <section className="Calculator">
            <h1 className="Section-Header">Calculate your bet</h1>
            <CalculatorForm {...props} handleInputChange={handleInputChange}/>
            <CalculatorResults {...props} />
        </section>
    );
}

export default Calculator;
